INSERT INTO `channel` (`channelId`, `channelName`, `channelBroadcastStart`, `channelDescription`, `channelOrder`, `channelImage`, `channelUrl`) VALUES
(1, 'Первый канал', '1951-03-22', 'Основой Первого канала является информационное вещание. Приоритеты канала:сохранение и развитие традиций просветительских, интеллектуальных, культурологических передач и программ, относящихся к развлекательному вещанию, в том числе самого популярного жанра - кинопоказа, а также новостного, общественно-политического и аналитического телевидения. Основой структуры Первого канала является информационное вещание.', 1, , 'http://1tv.ru'),
(2, 'Россия', '1991-05-13', 'В 1998 году РТР вошел в состав единого производственно-технологического комплекса государственных средств массовой информации (ВГТРК). Канал выпускает свою эксклюзивную новостную программу "Вести", большое количество развлекательных передач и художественных фильмов, занимается разработкой своих телевизионных проектов, ведет вещание на территории Европы (проект "РТР-Планета").', 2, , 'http://rutv.ru'),
(3, 'Культура', '1997-11-01', 'Передачи культурно-просветительского характера, документальные фильмы, детские и художественные передачи, трансляции из концертных залов, театров, музеев.', 3, , 'http://tvkultura.ru'),
(4, 'НТВ', '1993-10-10', 'Телекомпания НТВ создана в 1993 году, на данный момент НТВ - единственный частный российский телеканал, имеющий статус федерального. Аудитория НТВ в России превышает 110 миллионов человек. Помимо территории России, вещание НТВ распространяется на страны СНГ, а также Западную Европу, Ближний Восток, США и Канаду. Каждый сезон на канале новые программы, кинофильмы и сериалы и развлекательные проекты.', 4, , 'http://ntv.ru');
INSERT INTO `channel` (`channelId`, `channelName`, `channelBroadcastStart`, `channelDescription`, `channelOrder`, `channelImage`, `channelUrl`) VALUES
(5, 'РЕН ТВ', '1997-01-01', 'РЕН ТВ - один из крупнейших частных федеральных каналов в России. Канал РЕН ТВ начал вещание 1 января 1997 года. Он позиционируется как универсальный. В сетке вещания – отечественные и зарубежные фильмы, информационные программы, развлекательные передачи и музыка, спорт, кинодокументалистика, культовые сериалы класса “А” (“Х-files”, “Симпсоны”, “Ее звали Никита”). На РЕН ТВ создана собственная студии анимации и спецэффектов, которая выпускает фирменный оригинальный продукт РЕН ТВ (ноу-хау) – знаменитые виртуальные программы: новогоднее шоу РЕН ТВ “Вот и все – 3000”, первоапрельское “Обозрение – 3000”. На канале создано кинообъединение “РЕН – фильм”, выпустившее более двух десятков фильмов и сериалов.', 5, , 'http://ren-tv.com'),
(6, 'СТС', '1996-12-01', 'СТС-Москва – первое развлекательное телевидение. За 5 лет работы телеканал стал первым прибыльным бизнес-проектом на российском медиа-рынке. СТС предлагает зрителям программы собственного производства, специальные проекты и зарубежные развлекательные программы. Сейчас канал работает со 173 партнерами в 362 городах России.', 6, , 'http://ctc-tv.ru');
INSERT INTO `channel` (`channelId`, `channelName`, `channelBroadcastStart`, `channelDescription`, `channelOrder`, `channelImage`, `channelUrl`) VALUES
(7, 'Домашний', '2005-03-06', 'Телеканал «Домашний» - это новая концепция телевещания в России и настоящая «энциклопедия домашней жизни», это фабрика уюта, где главное - научить зрителей справляться с ежедневными бытовыми и психологическими проблемами. Дом. Семья. Личная жизнь. Эти понятия формулируют философию телеканала «Домашний».\r\nРассказывать. Сопереживать. Вместе искать выход из сложных ситуаций, делая жизнь гармоничной. Все программы «Домашнего» - один большой разговор, где каждый зритель найдет что-то свое. \r\nТелеканал «Домашний» - это лучший способ создать хорошее настроение всем членам семьи!', 7, , 'http://domashniy.dcafe.ru'),
(8, 'ТНТ', '1998-01-01', 'ТНТ - самая молодая и динамичная телесеть России. Объединяет 200 региональных телекомпаний. Проект ТНТ уникален: он объединяет сильнейшие стороны регионального и центрального вещания. ТНТ - премьерная телесеть. В ее сетке вещания - лучшие игровые и документальные фильмы, новинки международного телерынка, публицистические, детские, спортивные, познавательные, развлекательные, музыкальные передачи, ток-шоу. ТНТ первой занялась возрождением жанра телевизионного художественного сериала. Хит ТНТ "Улицы разбитых фонарей" стал дважды лауреатом ТЭФИ-99.', 8, , 'http://tnt.ru');

