INSERT INTO `episode` (`episodeId`, `seriesId`, `episodeName`, `episodeDescription`, `episodeNumber`, `episodeSeason`) VALUES
(4, 1, 'Декстер', 'Декстер — полицейский медик, специализирующийся на анализе крови после убийств. Он живет двойной жизнью. Вторая сторона личности Декстера — серийный убийца. Он вершит свое правосудие — убивает преступников, которых не смогла наказать полиция. Первым делом Декстер наказывает убийцу детей — Майка Донована. Предварительно перед казнью Декстер показывает Майку тела убитых им мальчиков, затем расчленяет преступника. Его следующей жертвой должен стать парковщик Джеми Джеворски, который убил свою жену и избежал правосудия. Декстер замечает, что он безошибочно чувствует убийцу и проникает в дом Джеми, чтобы найти доказательства.', 01, 01),
(5, 1, 'Крокодиловы слезы', 'За двенадцать лет службы в полиции Декстер расследовал 2103 дела. Он появляется в здании суда и обращает внимание на семью жертвы, Александра Прайса, убитого Мэтью Чамберсом — он ехал пьяным и сбил парня. Мэтью оправдывают, Декстер же берёт его на заметку. Тем временем находят рефрижератор. Когда его открывают, внутри лежит огромная глыба льда, в которую вморожены пять женских пальцев с разноцветным лаком на ногтях. Декстер удивлен тем, что убийца оставил им отпечатки, по которым они смогут опознать жертву.', 02, 01),
(6, 1, 'Черри со льдом', 'Декстер выбирает следующего преступника, которого ему предстоит убить. Это Джереми Даунс, молодой парень, отсидевший за убийство другого парня. Тогда ему было пятнадцать, а жертва была немногим старше Джереми. Декстер говорит сам себе, что ему нужно собрать доказательства, обвести дату на календаре и ждать. Он отмечает, что Джереми орудовал ножом, и эксперт отметил, что убийство было совершено в состоянии аффекта, но Декстер считает, что видел работу виртуоза, который не остановится на этом и продолжит убивать. Тем временем Дебра получает новый вызов — убийца на рефрижераторе оставил очередное тело — на стадионе под хоккейными воротами. Декстер появляется позже, и вид трупа, сложенного на льду, приводит его в восторг.', 03, 01),
(7, 1, 'Рука помощи', 'На месте преступления найдена отрезанная человеческая рука. Пока ещё Декстер не знает, дело ли это рук того убийцы на рефрижераторе, или нет. Убийца оставил полароидный снимок рядом с рукой - это послание от убийцы на рефрижераторе. Затем он приезжает на следующее место преступления - в этот раз обнаружена человеческая нога, также принадлежащая Тони Туччи. Нога одета в футбольный кроссовок и стоит рядом с мячом. Декстер подходит к Доаксу - за тем снова следят головорезы - и говорит, что это очевидно их неуловимый убийца на рефрижераторе, но пока он ещё не понял, что убийца пытается им передать.', 04, 01),
(8, 1, 'Любовь по-американски', 'На берег выносит тело, и отдыхающие натыкаются на него. По описанию, труп похож на Эрнесто, жениха Элины. Ночью Декстер пробирается на пирс, где на приколе стоит лодка Хорхе Кастильо. В каюте он находит несколько сотовых телефонов, и один из номеров совпадает с тем, по которому звонила Элина. В трюме Декстер обнаруживает несколько мёртвых тел, плавающих в воде. Кастильо топил их в трюме, а потом выбрасывал в океан. Новая жертва для мести найдена! Тем временем в больнице Дебра и Доакс допрашивают Тони, завязав ему глаза. Тот вспоминает, что убийца ел мятные леденцы от кашля и часто прочищал горло. Дебра находит обёртку от леденца. Анализ показывает, что на ней остался частичный отпечаток пальца и, возможно, образец ДНК.', 05, 01),
(9, 1, 'Вернуть отправителю', 'Убийца на рефрижераторе выследил Декстера, когда тот расправлялся с Кастильо и его женой. Теперь Декстеру придется подтасовать улики, так как убийца положил тело жены обратно в фургон, тем самым дав понять Декстеру, что это его ответ. В это время Дебра, Доакс и ЛаГуэрта обнаруживают в багажнике машины мальчика, который мог видеть то, что здесь произошло. Декстер видит, как его вытаскивают из багажника, и садится на лавку - он догадывается, что ребенок видел, как он складывал трупы в багажник. Декстер кивает в ответ и мысленно говорит сам себе, что не убивает детей, но этот мальчик представляет для него опасность.', 06, 01),
(10, 2, 'Все лгут', 'С воспитательницей детского сада Ребеккой Адлер случился приступ во время урока. Её направляют в госпиталь Принстон-Плейнсборо, где доктор Хаус и его команда (к которой недавно присоединился новый врач Эрик Форман) пытаются поставить ей диагноз. На приём в клинику к доктору Хаусу приходит «оранжевый пациент».', 01, 01),
(11, 2, 'Отцовство', '16-летний школьник, страдающий от ночных кошмаров и галлюцинаций, получает травму во время игры в лакросс. В клинике Хаус встречается с матерью, которая не верит в вакцинацию, и любителем судебных тяжб.', 02, 01),
(12, 2, 'Бритва Оккама', 'Студент коллежа неожиданно впадает в коллапс во время секса со своей девушкой. В клинике Хауса ждут женщина, у которой заболела нога после 6-мильной пробежки, и мальчик с mp3-плеером.', 03, 01),
(13, 2, 'Материнство', 'В родильном отделении больницы началась эпидемия неизвестной болезни, и доктор Хаус требует объявить карантин. На этот раз в клинику приходит женщина с паразитом.', 04, 01),
(14, 2, 'Куда ни кинь', 'На руках у монахини появились стигматы, но Хаус не верит в божественные знаки и пытается найти причины её болезни.', 05, 01),
(15, 2, 'Метод Сократа', 'Люси Пальмеро, страдающая от шизофрении, попадает в госпиталь с диагнозом «тромбоз глубоких вен». Её сыну удается уговорить доктора Хауса заняться этим случаем.', 06, 01),
(16, 1, 'Оно живёт!', 'События вокруг Декстера накаляются. Растут подозрения Доакса, раскрываются жертвы, и находят места захоронения трупов. Между тем, Пол беспокоит Риту из-за пропажи ботинка, а Дебра исследует травму, полученную во время инцидента с убийцей на рефрижераторе.', 01, 02);

