INSERT INTO `movie` (`movieId`, `countryId`, `movieName`, `movieLength`, `movieDescription`, `movieBudget`, `movieReturns`, `movieDate`) VALUES
(1, 216, 'Трансформеры', 0, 'В течение многих столетий две расы роботов-инопланетян — Автоботы и Десептиконы — вели войну, ставкой в которой была судьба Bселенной. И вот война докатилась до Земли. В то время, когда силы зла ищут ключ к верховной власти, наш последний шанс на спасение находится в руках юного землянина. Единственное, что стоит между несущими зло Десептиконами и высшей властью — это ключ, находящийся в руках простого парнишки. \r\n\r\nОбычный подросток, Сэм Уитвикки озабочен повседневными хлопотами — школа, друзья, машины, девочки. Не ведая о том, что он является последним шансом человечества на спасение, Сэм вместе со своей подругой Микаэлой оказываются вовлеченными в противостояние Автоботов и Десептиконов. Только тогда Сэм понимает истинное значение семейного девиза Уитвикки — «без жертв нет победы!»', 150000000, 708272581, '2009-07-01'),
(2, 216, 'Трансформеры 2', 180, 'Прошло два года с тех пор, как юный Сэм Уитвикки спас Вселенную, предотвратив глобальную битву между враждующими воинственными расами инопланетных роботов. Несмотря на свои героические подвиги, Сэм остается обычным подростком с обычными проблемами — поступление в колледж и родителями. Разумеется, отъезд будет тяжело воспринят лучшим другом, роботом — телохранителем Бамблби.\r\n\r\nСэм изо всех сил пытается забыть о конфликте в Мишн Сити и вернуться к нормальной жизни. Однако битва между Автоботами и Десептиконами, несмотря на гриф полной секретности, многое изменила. Агент Симмонс оставил службу. Его секретный Сектор 7 расформирован, на его месте возникло агентство НЕСТ. Его руководители — Леннокс и Эпс, уже вступавшие в смертельное противостояние с Десептиконами, сотрудничают с Автоботами, чтобы не допустить такого в будущем.\r\n\r\nК сожалению, правительство не отдает себе отчет в том, что месть неминуема. Пытаясь получить полный контроль над военными силами страны и покончить с глупой (по его мнению) правительственной инициативой — агентством НЕСТ, советник по национальной безопастности Теодор Галловэй убежден в том, что угроза из космоса давно миновала и человечеству не должно быть дела до конфликта Автоботов и Десептиконов.\r\n\r\nЖизнь налаживается, и годы, которые предстоит провести Сэму в колледже, обещают массу интересного, благодаря бойкому соседу по комнате Лео и не менее бойкой, но куда более интересной для Сэма новой знакомой Эллис. Но вдруг Сэма начинают посещать видения. Они поражают его подобно молниям, и Сэм хранит их в секрете, опасаясь, что причиной может оказаться случайно оставшийся у него после прошлого приключения осколок инопланетного энергетического куба.\r\n\r\nНесмотря на далеко идущие планы, Сэм снова оказывается вовлечен в войну между Автоботами и Десептиконами. Он не сразу понимает, что именно он сам и является ключом к разрешению вселенского противостояния Добра и Зла. Сэм и его друзья: Микаэла, Оптимус Прайм, Бамблби, Айрон Хайд, парни из НЕСТ следуют семейному завету Уитвикки: Без жертв нет победы!', 200000000, 419350220, '2009-06-24');

