INSERT INTO `series` (`seriesId`, `countryId`, `seriesName`, `seriesStatus`, `seriesDescription`, `seriesLength`) VALUES
(1, 216, 'Декстер', 'продолжаются съемки', 'В детстве Декстер Морган был усыновлён выдающимся полицейским Майами Гарри Морганом, который быстро понял, что с его приёмным сыном не всё в порядке. Он не испытывает никаких эмоций и периодически хочет убить другое живое существо. Понимая, что эта нужда просто так не уйдёт, Гарри наставляет сына, что убивать следует лишь тех, «кто этого заслуживает», то есть других убийц. Он также обучает его, как при этом не оставлять следов и поддерживать фасад обычного человека, испытывающего нормальные человеческие эмоции. Следуя наставлениям покойного Гарри, Декстер следит за своими жертвами и, лишь убедившись в их вине, планирует акт возмездия. Убив свою жертву, он расчленяет тело и избавляется от него, оставляя себе каплю крови на память.\r\n\r\nНесмотря на эмоциональную отчуждённость, у Декстера есть близкие: сестра Дебра, подруга Рита и её дети (Коди и Эстер). Не испытывая чувств в обычном человеческом понимании, Декстер всё же способен на проявления некого участия и жалости по отношению к перечисленным людям. Некоторые в полицейском департаменте считают Декстера своим другом, например детектив Анджел Батиста или судебный эксперт Винс Масука.', 45),
(2, 216, 'Доктор Хаус', 'продолжаются съемки', 'Доктор Хаус (в исполнении английского актёра Хью Лори, получившего за эту роль «Золотой Глобус» в 2006 и 2007 годах) — блестящий специалист в области заболеваний почек (нефрология) и инфекционных болезней, но из-за некоторых особенностей его характера его нельзя назвать любимцем пациентов и коллег — он замкнут, резок и циничен, склонен к мизантропии и бунтарству. Он не обременяет себя соблюдением правил хорошего тона и временами кажется, что он полностью лишён чувства сострадания (что, однако, неверно). Лучше всего говорит о жизненной позиции Хауса цитата доктора Формана: «Он не нарушает правила, он их игнорирует»; а также его любимое утверждение — «Все лгут». Как ни странно, именно этот подход нередко помогает ему разобраться в самых сложных и невероятных случаях, а значит спасти жизнь ещё одному пациенту.\r\n\r\nЕго ассистенты — молодые и многообещающие врачи — иммунолог Эллисон Кэмерон (Дженнифер Моррисон), невролог Эрик Форман (Омар Эппс) и реаниматолог Роберт Чейз (Джесси Спенсер). В четвертом сезоне появятся новые ассистенты Тринадцатая (Реми Хадли) (Оливия Уайлд), Лоренс Катнер (Кал Пенн) и Крис Тауб (Питер Джейкобсон).\r\n\r\nДругие его соратники — доктор Джеймс Уилсон (Роберт Шон Леонард), онколог и, возможно, единственный друг Хауса, и доктор Лиза Кадди (Лиза Эдельстин), эндокринолог, а также заведующая больницей.\r\n\r\nХаус часто выражает глубокое и укоренившееся разочарование в людях, но, возможно, его язвительность объясняется хронической болью в ноге (инфаркт четырёхглавой мышцы правого бедра), из-за чего он ходит с тростью. Хаус постоянно принимает викодин от боли в ноге (и имеет зависимость от него), а также когда какое-то дело утомляет или раздражает его.', 45);

